//So essentially I trained a small image with embeddings(here its 64*64 by 16 embeddings), which after interpolation we pass through a neural net to get the output color
//The ouput neural net is just a siren here
//The embeddings are interpolated using the hacky C2 smooth interpolation, to fix the 0 nodes in the gradient we have 2 grids, one offset by half pixel
//To store such a large embedding here I use quantization
vec4 smoothSample(sampler2D ch, vec2 uv)
{
	uv = uv*iResolution.xy + 0.5;
	vec2 iuv = floor(uv);
	vec2 fuv = fract(uv);
	uv = iuv + fuv*fuv*(3.0-2.0*fuv);
	uv = (uv - 0.5)/iResolution.xy;
	return texture(ch, uv);
}

vec4 sampleEmbed(sampler2D ch, vec2 uv, int embed, float offset)
{
    vec2 pix = (1.0 - uv) * float(embed_texture-3) + 2.0 + vec2(embed, 0) * float(embed_texture + 2) + offset;
    return smoothSample(ch, pix/iResolution.xy);
}

vec3 decode(vec2 uv)
{
    uv.x = 1.0 - uv.x;
    if(uv.x < 0.0 || uv.x > 1.0 || uv.y < 0.0 || uv.y > 1.0) return vec3(0.0);
    vec4 e0_0 = sampleEmbed(iChannel0, uv, 0, 0.0);
    vec4 e0_1 = sampleEmbed(iChannel1, uv, 0, 0.0);
    vec4 e0_2 = sampleEmbed(iChannel2, uv, 0, 0.5);
    vec4 e0_3 = sampleEmbed(iChannel3, uv, 0, 0.5);

    return model(e0_0, e0_1, e0_2, e0_3);
}

void mainImage( out vec4 fragColor, in vec2 fragCoord )
{
    vec2 uv = 1.0*((fragCoord - vec2(iResolution.x - iResolution.y, 0)*0.5)/iResolution.y - 0.5) + 0.49999;

    //vec3 col = sampleEmbed(iChannel1, uv, 0, 0.0).xyz;
    vec3 col = decode(uv);

    fragColor = vec4(col,1.0);
}

void mainImage( out vec4 fragColor, in vec2 fragCoord )
{
    ivec2 c = ivec2(fragCoord);

    if((c.x >= (embed_texture+2)*embed_channels/4) || (c.y >= (embed_texture+2)) || iFrame > 8) discard;

    int ch = c.x / (embed_texture + 2);

    c = clamp(c - 1 - ivec2(ch*(embed_texture + 2), 0), 0, embed_texture-1);

    fragColor = EmbedDequantized(embed0_quant, embed0_quant_min, embed0_quant_max, ch, c.x, c.y);
}

void mainImage( out vec4 fragColor, in vec2 fragCoord )
{
    ivec2 c = ivec2(fragCoord);

    if((c.x >= (embed_texture+2)*embed_channels/4) || (c.y >= (embed_texture+2)) || iFrame > 8) discard;

    int ch = c.x / (embed_texture + 2);

    c = clamp(c - 1 - ivec2(ch*(embed_texture + 2), 0), 0, embed_texture-1);

    fragColor = EmbedDequantized(embed1_quant, embed1_quant_min, embed1_quant_max, ch, c.x, c.y);
}

void mainImage( out vec4 fragColor, in vec2 fragCoord )
{
    ivec2 c = ivec2(fragCoord);

    if((c.x >= (embed_texture+2)*embed_channels/4) || (c.y >= (embed_texture+2)) || iFrame > 8) discard;

    int ch = c.x / (embed_texture + 2);

    c = clamp(c - 1 - ivec2(ch*(embed_texture + 2), 0), 0, embed_texture-1);

    fragColor = EmbedDequantized(embed2_quant, embed2_quant_min, embed2_quant_max, ch, c.x, c.y);
}

void mainImage( out vec4 fragColor, in vec2 fragCoord )
{
    ivec2 c = ivec2(fragCoord);

    if((c.x >= (embed_texture+2)*embed_channels/4) || (c.y >= (embed_texture+2)) || iFrame > 8) discard;

    int ch = c.x / (embed_texture + 2);

    c = clamp(c - 1 - ivec2(ch*(embed_texture + 2), 0), 0, embed_texture-1);

    fragColor = EmbedDequantized(embed3_quant, embed3_quant_min, embed3_quant_max, ch, c.x, c.y);
}
